import{_ as a,c as r,o as t,ag as n}from"./chunks/framework.BtnfViKx.js";const u=JSON.parse('{"title":"FAQ","description":"","frontmatter":{},"headers":[],"relativePath":"pages/FAQ.md","filePath":"pages/FAQ.md"}'),o={name:"pages/FAQ.md"};function s(i,e,p,h,c,l){return t(),r("div",null,[...e[0]||(e[0]=[n('<h1 id="faq" tabindex="-1">FAQ <a class="header-anchor" href="#faq" aria-label="Permalink to &quot;FAQ&quot;">​</a></h1><h3 id="how-can-i-contribute" tabindex="-1">How Can I Contribute? <a class="header-anchor" href="#how-can-i-contribute" aria-label="Permalink to &quot;How Can I Contribute?&quot;">​</a></h3><p>Please check our <a href="https://github.com/UI5/cli/blob/main/CONTRIBUTING.md" target="_blank" rel="noreferrer">Contribution Guidelines</a>.</p><h3 id="how-can-i-obtain-support" tabindex="-1">How Can I Obtain Support? <a class="header-anchor" href="#how-can-i-obtain-support" aria-label="Permalink to &quot;How Can I Obtain Support?&quot;">​</a></h3><p>Please follow our <a href="https://github.com/UI5/cli/blob/main/CONTRIBUTING.md#report-an-issue" target="_blank" rel="noreferrer">Contribution Guidelines</a> on how to report an issue.</p><h3 id="what-s-the-difference-between-openui5-and-sapui5" tabindex="-1">What&#39;s the Difference Between OpenUI5 and SAPUI5? <a class="header-anchor" href="#what-s-the-difference-between-openui5-and-sapui5" aria-label="Permalink to &quot;What&#39;s the Difference Between OpenUI5 and SAPUI5?&quot;">​</a></h3><p>The open source project <a href="https://openui5.org/" target="_blank" rel="noreferrer">OpenUI5</a> provides most of the fundamental framework features. <a href="https://ui5.sap.com/" target="_blank" rel="noreferrer">SAPUI5</a> enhances this by providing <strong>additional libraries</strong> under a <strong>different license</strong>.</p><p>OpenUI5 is provided under the Apache 2.0 license. The SAPUI5 packages that are consumed in UI5 CLI are provided under the terms of the <a href="https://tools.hana.ondemand.com/developer-license-3.1.txt" target="_blank" rel="noreferrer">SAP Developer License Agreement</a>.</p><p>Note that projects which use the OpenUI5 framework cannot depend on projects that use the SAPUI5 framework. However, SAPUI5 projects can depend on OpenUI5 projects.</p><p>Please also see the <a href="https://ui5.sap.com/#/topic/5982a9734748474aa8d4af9c3d8f31c0" target="_blank" rel="noreferrer">UI5 SDK documentation &quot;SAPUI5 vs. OpenUI5&quot;</a>.</p><h3 id="why-package-json-why-npm" tabindex="-1">Why package.json? / Why npm? <a class="header-anchor" href="#why-package-json-why-npm" aria-label="Permalink to &quot;Why package.json? / Why npm?&quot;">​</a></h3><p>Currently, UI5 CLI can only resolve dependencies defined in a <code>package.json</code> file. This might change in the future by adding Translators for additional dependency management systems.</p><p>To manage your dependencies, you can use almost any <code>Node.js</code> package manager that relies on <code>package.json</code> files. Popular ones are <a href="https://www.npmjs.com/" target="_blank" rel="noreferrer">npm</a>, <a href="https://yarnpkg.com/" target="_blank" rel="noreferrer">Yarn</a> and <a href="https://pnpm.js.org/" target="_blank" rel="noreferrer">pnpm</a>. UI5 CLI itself uses <a href="https://www.npmjs.com/" target="_blank" rel="noreferrer">npm</a>.</p><p>UI5 CLI resolves dependencies almost the same way <code>Node.js</code> does when executing a <code>require</code> / <code>import</code> statement.</p><h3 id="where-are-the-npm-packages" tabindex="-1">Where are the npm Packages? <a class="header-anchor" href="#where-are-the-npm-packages" aria-label="Permalink to &quot;Where are the npm Packages?&quot;">​</a></h3><ul><li><a href="https://www.npmjs.com/org/openui5" target="_blank" rel="noreferrer">OpenUI5 Libraries</a></li><li><a href="https://www.npmjs.com/org/sapui5" target="_blank" rel="noreferrer">SAPUI5 Libraries</a></li><li><a href="https://www.npmjs.com/org/ui5" target="_blank" rel="noreferrer">UI5 CLI Modules</a></li></ul>',16)])])}const f=a(o,[["render",s]]);export{u as __pageData,f as default};
